import React from 'react';
import Navstuff from './components/Navstuff';
import styles from './App.css';

import {
  TaggedContentCard,
} from 'react-ui-cards';
import { Container } from 'react-bootstrap';

function App() {
  return (

  <div>
     <Navstuff />
    <div style={styles }>
    <TaggedContentCard
      href='https://github.com/nukeop'
      thumbnail='https://images.livemint.com/rf/Image-621x414/LiveMint/Period2/2016/09/22/Photos/Processed/kirana3-kVmB--621x414@LiveMint.JPG'
      title='Shop Name'
      description='Shop Description'
      tags={[
        'tag1',
        'tag2',
        'tag3'
      ]}/>
    <TaggedContentCard
      href='https://github.com/nukeop'
      thumbnail='https://images.livemint.com/rf/Image-621x414/LiveMint/Period2/2016/09/22/Photos/Processed/kirana3-kVmB--621x414@LiveMint.JPG'
      title='Shop Name'
      description='Shop Description'
      tags={[
        'tag1',
        'tag2',
        'tag3'
      ]}/>
    <TaggedContentCard
      href='https://github.com/nukeop'
      thumbnail='https://images.livemint.com/rf/Image-621x414/LiveMint/Period2/2016/09/22/Photos/Processed/kirana3-kVmB--621x414@LiveMint.JPG'
      title='Shop Name'
      description='Shop Description'
      tags={[
        'tag1',
        'tag2',
        'tag3'
      ]}/>
    </div>
  </div>

  );
}

export default App;
